import React, { useState, useEffect } from "react";
import axios from 'axios';

function TweetsFetching() {
  const [setTweets] = useState([]);

  useEffect(() => { 
      axios
      .get("http://localhost:3000/tweets/index.json")
      .then(res => {
        console.log(res)            
        setTweets(res.data)
      }, [])

  })   
return (
    <div>
      <ul>
        {}
      </ul>
    </div>

)
};
export default TweetsFetching
